import React from 'react'
import ToDoComp from './ToDoComp'

function ToDosComp(props) {
  return (
    <>
    <ul>
        {props.toDos.map((i)=><li key={i.id}>{i.note}</li>) }
    </ul>
    </>
  )
}

export default ToDosComp
